import time

def lengthOfLongestSubstring(s):
    """
    :type s: str
    :rtype: int
    """
    t0 = time.clock()
    max_max = len({ item for item in s })
    max_res = 0        
    for i in range(len(s)):
        max_list = []
        j = i
        while j <=len(s)-1 and s[j] not in max_list:
            max_list.append(s[j])
            j+=1
        if len(max_list) > max_res:
            max_res = len(max_list)
    t1 = time.clock()
    print(t1-t0)
    return max_res


def lengthOfLongestSubstring1(s):
    t0 = time.clock()
    l = len(s)
    m = 0
    for i in range(l):
        hset = set()
        for j in range(i, l):
            if s[j] in hset:
                break                    
            else:
                hset.add(s[j])
                n = j - i + 1
                if n > m:
                    m = n
    t1 = time.clock()
    print(t1-t0)
    return m


def lengthOfLongestSubstring2(s):
    t0 = time.clock()
    l = len(s)
    m = 0
    hset = set()
    i, j = 0, 0
    while i<l and j<l:
        if s[j] not in hset:
            hset.add(s[j])
            n = j - i + 1
            if n > m:
                m = n
            j+=1 
        else:
            hset.remove(s[i])
            i+=1
    t1 = time.clock()
    print(t1-t0)
    return m   


